"use strict";
var ddpatientFilters = angular.module("ddpatientFilters", []);
ddpatientFilters.filter("titleCase", function () {
    var a = function (b) {
        var d = b.split(" ");
        for (var c = 0; c < d.length; c++) {
            d[c] = d[c].charAt(0).toUpperCase() + d[c].slice(1)
        }
        return d.join(" ")
    };
    return a
});
ddpatientFilters.filter("dateTranfer", function () {
    var a = function (b) {
        var c = new Date(b);
        var d = c.getMonth() + 1;
        var e = c.getFullYear() + "年" + d + "月" + c.getDate() + "日星期" + "日一二三四五六".charAt(c.getDay()) + "<br/><br/>";
        return e
    };
    return a
});
ddpatientFilters.filter("dateForOrder", function () {
    var a = function (b) {
        var f = [];
        for (var e = 0; e < b.length; e++) {
            var d = new Date(b[e]);
            var c = new Date(d.getFullYear() + "-" + (d.getMonth() + 1) + "-" + (d.getDate() + 1));
            f.push({startTime: c, endTime: c, allDay: true})
        }
        return f
    };
    return a
});
ddpatientFilters.filter("gender", function () {
    var a = function (b) {
        var c = "男";
        if (b == "1") {
            c = "女"
        }
        return c
    };
    return a
});
ddpatientFilters.filter("dateFormat1", function () {
    var a = function (b) {
        var d = new Date(b);
        var e = d.getFullYear();
        var f = d.getMonth() + 1;
        var g = d.getDate();
        var c = e + "." + f + "." + g;
        return c
    };
    return a
});
ddpatientFilters.filter("ageFormat", function () {
    var a = function (d) {
        var c = new Date();
        var e = new Date(d);
        var b = c.getFullYear() - e.getFullYear();
        return b
    };
    return a
});
ddpatientFilters.filter("registerStatus", function () {
    var a = function (c) {
        var b = "排队中";
        if (c == "0") {
            b = "草稿"
        } else {
            if (c == "1") {
                b = "已预约"
            } else {
                if (c == "2") {
                    b = "已挂号"
                } else {
                    if (c == "3") {
                        b = "已诊疗"
                    } else {
                        if (c == "4") {
                            b = "已取消"
                        } else {
                            if (c == "5") {
                                b = "已评价"
                            }
                        }
                    }
                }
            }
        }
        return b
    };
    return a
});
ddpatientFilters.filter("timeSlot", function () {
    var a = function (c) {
        var b = "全天";
        if (c == "1") {
            b = "上午"
        } else {
            if (c == "2") {
                b = "下午"
            } else {
                if (c == "3") {
                    b = "晚上"
                }
            }
        }
        return b
    };
    return a
});
ddpatientFilters.filter("namePart", function () {
    var a = function (b) {
        var c = b.substring(0, 1);
        if (c) {
            return c + "**"
        } else {
            return "***"
        }
    };
    return a
});
ddpatientFilters.filter("doctorHospitalsStatus", function () {
    var a = function (c) {
        var b = "号满排队";
        if (c == "0") {
            b = " 号满排队"
        } else {
            if (c == "1") {
                b = "已经排队"
            } else {
                if (c == "2") {
                    b = "预约挂号"
                } else {
                    if (c == "3") {
                        b = "已经挂号"
                    }
                }
            }
        }
        return b
    };
    return a
});
ddpatientFilters.filter("fontColorFilter", function () {
    var a = function (b) {
        var c = "color:green";
        if (b == "挂号诚意金") {
            c = "color:black"
        } else {
            if (b == "诊疗后退款") {
                c = "color:blue"
            } else {
                c = "color:green"
            }
        }
        return c
    };
    return a
});
ddpatientFilters.filter("cut", function () {
    return function (c, e, a, b) {
        if (!c) {
            return ""
        }
        a = parseInt(a, 10);
        if (!a) {
            return c
        }
        if (c.length <= a) {
            return c
        }
        c = c.substr(0, a);
        if (e) {
            var d = c.lastIndexOf(" ");
            if (d != -1) {
                c = c.substr(0, d)
            }
        }
        return c + (b || " …")
    }
});